project_info.prj_overview:
Overview
Promote and accelerate adoption of conservation/reduced tillage on selected farm fields in the Vermont portion of northern Lake Champlain drainage.  The project will focus on (but not be limited to) the special target areas of the Rock River and Saxe Brook (waterbody ID number 05-01), Jewett Brook (05-07), Rugg Brook (05-07), Mill River (05-07), and watersheds drained by Berry, Godin, Samosonville and Trout brooks (06-04).

Objectives
-Develop suitable training and demo trials.
-Develop structure for cost share to assist producers willing to use practice.
-Develop designs to implement when retro-fitting specific equipment.

Methods
Project will build upon prior efforts done by UVM-EXT to accelerate the adoption of reduced tillage annual cropping systems by: 
1) providing trainings and demonstration trials to help farmers successfully implement reduced tillage;
2) providing cost share funds to try a new and perceived high risk practice; 
3) increase reduced tillage equipment availability by  retrofitting at least two corn planters to become no-till capable;
4) documenting the ability of reduced tillage systems to improve soil and water quality as well as farm viability; 
5) produce videos and published materials for distribution to educate more farmers on implementing reduced tillage systems on their farms.
